import React, { useState } from "react";

const TeamManagement = () => {
  const [findTeamFormData, setFindTeamFormData] = useState({
    hackathonName: "",
    teamName: "",
    email: "",
  });

  const [createTeamFormData, setCreateTeamFormData] = useState({
    teamName: "",
    players: "",
    hackathon: "",
    project: "",
    captions: "",
    email: "",
  });

  const handleFindTeamChange = (e) => {
    const { name, value } = e.target;
    setFindTeamFormData({ ...findTeamFormData, [name]: value });
  };

  const handleCreateTeamChange = (e) => {
    const { name, value } = e.target;
    setCreateTeamFormData({ ...createTeamFormData, [name]: value });
  };

  const handleFindTeamSubmit = () => {
    const { hackathonName, teamName, email } = findTeamFormData;
    if (!hackathonName || !teamName || !email) {
      alert("Please fill in all required fields for Find a SkillHunt.");
      return;
    }
    console.log("Find Team Form Submitted:", findTeamFormData);
    alert("Team search submitted successfully!");
    setFindTeamFormData({ hackathonName: "", teamName: "", email: "" });
  };

  const handleCreateTeamSubmit = () => {
    const { teamName, players, hackathon, email } = createTeamFormData;
    if (!teamName || !players || !hackathon || !email) {
      alert("Please fill in all required fields for Create a Team.");
      return;
    }
    console.log("Create Team Form Submitted:", createTeamFormData);
    alert("Team created successfully!");
    setCreateTeamFormData({
      teamName: "",
      players: "",
      hackathon: "",
      project: "",
      captions: "",
      email: "",
    });
  };

  const boxStyle = {
    width: "450px",
    padding: "2rem",
    backgroundColor: "#ffffff",
    borderRadius: "10px",
    boxShadow: "0 4px 12px rgba(0, 0, 0, 0.1)",
  };

  const formStyle = {
    display: "flex",
    flexDirection: "column",
    gap: "1rem",
  };

  const inputStyle = {
    width: "100%",
    padding: "0.5rem",
    border: "1px solid #E5E5E5",
    borderRadius: "5px",
  };

  const buttonStyle = {
    width: "100%",
    backgroundColor: "#007AFF",
    color: "#ffffff",
    fontWeight: "600",
    padding: "0.75rem",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    transition: "background-color 0.3s",
  };

  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        background: "linear-gradient(135deg, #007AFF, #4C82F0)",
        minHeight: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div style={{ display: "flex", gap: "2rem" }}>
        {/* Find a SkillHunt Box */}
        <div style={boxStyle}>
          <h2
            style={{
              textAlign: "center",
              color: "#007AFF",
              fontWeight: "600",
              marginBottom: "1.5rem",
            }}
          >
            Find a SkillHunt
          </h2>
          <form style={formStyle}>
            <input
              type="text"
              name="hackathonName"
              value={findTeamFormData.hackathonName}
              onChange={handleFindTeamChange}
              placeholder="Hackathon Name"
              style={inputStyle}
            />
            <input
              type="text"
              name="teamName"
              value={findTeamFormData.teamName}
              onChange={handleFindTeamChange}
              placeholder="Team Name"
              style={inputStyle}
            />
            <input
              type="email"
              name="email"
              value={findTeamFormData.email}
              onChange={handleFindTeamChange}
              placeholder="Email"
              style={inputStyle}
            />
            <button
              type="button"
              onClick={handleFindTeamSubmit}
              style={buttonStyle}
              onMouseEnter={(e) => (e.target.style.backgroundColor = "#005FCC")}
              onMouseLeave={(e) => (e.target.style.backgroundColor = "#007AFF")}
            >
              Submit
            </button>
          </form>
        </div>

        {/* Create a Team Box */}
        <div style={boxStyle}>
          <h2
            style={{
              textAlign: "center",
              color: "#007AFF",
              fontWeight: "600",
              marginBottom: "1.5rem",
            }}
          >
            Create a Team
          </h2>
          <form style={formStyle}>
            <input
              type="text"
              name="teamName"
              value={createTeamFormData.teamName}
              onChange={handleCreateTeamChange}
              placeholder="Team Name"
              style={inputStyle}
            />
            <input
              type="number"
              name="players"
              value={createTeamFormData.players}
              onChange={handleCreateTeamChange}
              placeholder="Number of Players"
              style={inputStyle}
            />
            <input
              type="text"
              name="hackathon"
              value={createTeamFormData.hackathon}
              onChange={handleCreateTeamChange}
              placeholder="Hackathon Name"
              style={inputStyle}
            />
            <input
              type="text"
              name="project"
              value={createTeamFormData.project}
              onChange={handleCreateTeamChange}
              placeholder="Project Name"
              style={inputStyle}
            />
            <textarea
              name="captions"
              value={createTeamFormData.captions}
              onChange={handleCreateTeamChange}
              rows="3"
              placeholder="Team Captions"
              style={inputStyle}
            />
            <input
              type="email"
              name="email"
              value={createTeamFormData.email}
              onChange={handleCreateTeamChange}
              placeholder="Email"
              style={inputStyle}
            />
            <button
              type="button"
              onClick={handleCreateTeamSubmit}
              style={buttonStyle}
              onMouseEnter={(e) => (e.target.style.backgroundColor = "#005FCC")}
              onMouseLeave={(e) => (e.target.style.backgroundColor = "#007AFF")}
            >
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default TeamManagement;
